import React from 'react';// Assuming you will create a CSS file for specific styles

const LandingPage: React.FC = () => {
    return (
        <div className="landing-page">
            <h1>Sheik Saqib Ahmed</h1>
            <h2>Full Stack Developer</h2>
            <p>A passionate developer with expertise in building dynamic and responsive web applications.</p>
            <div className="cta-buttons">
                <a href="/resume/Sheik_Saqib_Ahmed.pdf" className="btn">Download Resume</a>
                <a href="#contact" className="btn">Contact Me</a>
            </div>
        </div>
    );
};

export default LandingPage;
